        `,description:"The versatile conversational AI from OpenAI, known for its fluency and broad knowledge base.",rating:4.5,detailedDescription:"Developed by OpenAI, ChatGPT is a highly influential large language model that popularized conversational AI. It is known for its ability to generate human-like text, answer questions, write code, and engage in creative writing. It's built upon the Generative Pre-trained Transformer (GPT) architecture.",documentationUrl:"https://openai.com/chatgpt",isAgentic:!0,trainingDataSize:"Over 1.76 trillion parameters (GPT-4)",strengths:["Excellent conversational flow","Vast general knowledge","Strong creative writing capabilities"],weaknesses:["Knowledge cutoff (not always real-time)","Can sometimes 'hallucinate' facts"],useCases:[{title:"Content Creation",description:"Draft blog posts, marketing copy, or scripts in various styles."},{title:"Interactive Tutoring",description:"Explain complex topics and answer follow-up questions in a conversational manner."}]},{name:"Claude",icon:`
